      <div class="p-5 bg-white rounded-lg flex items-center justify-between space-x-8">
      <div>
        <p class='text-4xl font-mono text-center'>justin reid</p>
      </div>
      </div>
    </div>
  </div>
</div>
  );
}

export default App;
